import '../../styles/navbar.css' ;



function Navbar(){
    return(
        <div className="navbar">
            <ul className="nav-list">
                <li>Home</li>
                <li>About</li>
                <li>Contact</li>
            </ul>
        </div>
    );
}

export default Navbar;
